var tipuesearch = {"pages": [{'title': 'HOME', 'text': '', 'tags': '', 'url': 'HOME.html'}, {'title': 'Introduction', 'text': 'Github:\xa0  許耀中的Github \n Website: 許耀中的 Website \n Youtube: 許耀中的Youtube Stage1 分組倉儲: \n \n \n', 'tags': '', 'url': 'Introduction.html'}, {'title': 'leo', 'text': '', 'tags': '', 'url': 'leo.html'}, {'title': 'edit blog', 'text': '一開始你的leo是黑色的， 如果你想換成白色的 \n step1. 到File裡的 Open-Outline \n \n Step2.進到你的tmp →cd2021→config \n \n Step3. touch pelican.leo \n \n \n 新建disqus \n \n \n 改設定到遠端的pelican 劃紅線的是需要改的設定\xa0 discqus sitename 填你新建disqus的名字(Webside name) \n \n 指令 @others 就是可以當編輯這個網頁要編輯下一張的時候，下一張的開頭位置會是你上一張結尾的後面 \n 可以繼續編排不會亂 \n \n', 'tags': '', 'url': 'edit blog.html'}, {'title': 'edit\xa0Reveal', 'text': '1.先進入Leo \n \n 2.到cd2021 ➝config \n \n 3.選擇下面的reveal.leo \n \n 4.就可以開始編輯了 \n \n', 'tags': '', 'url': 'edit\xa0Reveal.html'}, {'title': 'repositories\xa0create', 'text': 'notice: 因為cmsimde改版 所以設定全部更新 \n (1)system  cd2021可攜系統\xa0 \n (2)download\xa0  kmol2021 spring\xa0 v2.7z \n (3) 改 gitconfig \xa0 \n \xa0 \n \n \n \n (4)Repository: \xa0 https://github.com/mdecourse/cmstemplate \n \xa0 利用 cmstemplate 建立以 CMSiMDE 作為子模組的動態與靜態網站方法為: \n \n 登入 Github 帳號 \n 將瀏覽器指向 \xa0 https://github.com/mdecourse/cmstemplate \n \n \n \xa0(5) inside the page \n \n \n', 'tags': '', 'url': 'repositories\xa0create.html'}, {'title': 'week', 'text': '', 'tags': '', 'url': 'week.html'}, {'title': 'week1', 'text': '第一階段分組協同實習: \n 每週分組報告必須包含 html, pdf 與 Youtube 影片: \n 標題: \xa0 2021-協同產品設計實習-stage1-ag1 \n 專題題目: \n 第一位組員學號:40823111 \n 第二位組員學號:40823139 \n \n \n 交付給各組的實習任務: \n \n 請在各組組長的 Github 帳號下建立各組的分組網站, 惟在 W1 進行各班定組序過程中, 發現即便採用 Ethercalc 以網際協同方式同步讓各班自選組員填入兩兩成組的學員學號, 但仍缺人工或自動定各班組序的有效方案, 在此責成各組在進行自選的協同產品開發項目之際 (W2-W4), 將此議題列為必選的題目之一, 詳細說明各組認為最有效率的第一階段與訂定組序的方法及流程. \n 此外, 為了讓各組在 stage1 分組協同實習過程, 能透過網誌發表各組組員在 W2-W4 過程中的各項作為與心得報告, 說明可利用 Leo Editor 協助 CMSiMDE 中的 Pelican 發表協同網誌, 其目的是讓各分組在協同期間, 能完整呈現各階段所留下的網誌紀錄. 但此方式必須熟悉 Leo Editor 的操作, 因此有關透過 Pelican 建立協同網誌一事, 除利用 Leo Editor 協助設定並建立 pelican 網誌外, 也將此議題列為各組在 Stage1 協同產品設計流程中必選題目之二, 請各組詳細說明採用或不採用 Leo Editor 的兩種情況下, 各組員在設定與建立協同網誌的過程所可能遭遇或產生的問題與解決方案. \n \n', 'tags': '', 'url': 'week1.html'}, {'title': 'week2', 'text': '我們的主題 及 進度說明 \n 題目:套圈遊樂器 動機:經常於夜市中看到的套圈圈，於軟體中進行模擬與參數調整，對其分析統整，求得各類結果 第二周:零件創建與機構改善 第三周:軟體模擬與程式編輯 第四周:統整結果與報告內容 \n \n 這是把圈圈送到上面的運輸機構 \n \n \n \n \n', 'tags': '', 'url': 'week2.html'}]};